(6, 3, 'PHP echo and print Statements', 'echo and print are more or less the same. They are both used to output data to the screen.\r\n\r\nThe differences are small: echo has no return value while print has a return value of 1 so it can be used in expressions. echo can take multiple parameters (although such usage is rare) while print can take one argument. echo is marginally faster than print.', NULL, 0, '[\"echo has no return value while print has a return value of 1\",\"echo has  return value while print has a return value of 0\",\"echo has  return value while print has a no return value\",\"none of these\"]', '[\"echo has no return value while print has a return value of 1\"]', '2022-03-22 23:41:56', NULL, 0),
(7, 3, 'PHP Data Types', 'String\r\nInteger\r\nFloat (floating point numbers - also called double)\r\nBoolean\r\nArray\r\nObject\r\nNULL\r\nResource', NULL, 0, '[\"Float (floating point numbers - also called double)\",\"String Integer\",\"Array Object NULL Resource\",\"All Of these\"]', '{\"3\":\"All Of these\"}', '2022-03-22 23:44:06', NULL, 0),
(8, 3, 'types of  PHP Loops', 'while - loops through a block of code as long as the specified condition is true\r\ndo...while - loops through a block of code once, and then repeats the loop as long as the specified condition is true\r\nfor - loops through a block of code a specified number of times\r\nforeach - loops through a block of code for each element in an array', NULL, 0, '[\"while\",\"do...while\",\"for  ,  foreach \",\"all\"]', '{\"3\":\"all\"}', '2022-03-22 23:45:25', NULL, 0),
(9, 2, 'correct spelling Java Script', ' Java Script', NULL, 0, '[\" Java Scriptt\",\" Jaba Script\",\" Javan Script\",\" Jva Script\"]', '[\" Java Scriptt\"]', '2022-03-22 23:47:07', NULL, 0),
(10, 2, 'method', 'post get put', NULL, 0, '[\"get\",\"post\",\"put\",\"all\"]', '{\"3\":\"all\"}', '2022-03-22 23:48:04', NULL, 0),
(11, 2, 'PHP readfile&#40;&#41; Function', 'The readfile&#40;&#41; function reads a file and writes it to the output buffer.', NULL, 0, '[\"The readfile&#40;&#41; function reads nothing\",\"The readfile&#40;&#41; function reads a file and writes it to the output buffer.\",\"The readfile&#40;&#41; function write nothing\",\"all\"]', '{\"1\":\"The readfile&#40;&#41; function reads a file and writes it to the output buffer.\"}', '2022-03-22 23:49:40', NULL, 0);
